description:
Maddy is awaiting Bill to to take her to the airport when she finally hears a knock at the door. Bill asks why his sister wasn't the one to see her off since they are best friends. Maddy tells Bill that his sister has her finals for school and couldn't make it. Maddy is ready to go but, Bill tells her she has loads of time and that they should just relax in the house. Bill has had a crush on Maddy for a while, he realizes that she won't be coming back for some time and this is his last chance to let her know how he feels! When he tells her she lets him know that she had a crush on him too though, she never did anything about it because she didn't want it to be a weird situation around his sister. Well, his sister isn't around, and she's leaving for the semester! They skip to the courtship and get straight down to business!


